import random
import gmpy2

enc_flag  = hex()

enc_flag = enc_flag[2:-1].decode('hex')
ch = ""

def rand_func(a,d):
    random.seed(d)
    b = []
    for i in range(1,len(a)+1):
        b.append((random.randint(1,1000))^i)
    return b

def xor(a,d):
    b = ""
    for i in range(len(a)):
        s = rand_func(a,d)
        b += chr((ord(a[i])^d^s[i])%256)
        d += 1
    return b

for i in range(0,len(enc_flag),8):
    ch +=chr(int(enc_flag[i:i+8],2))

for i in range(1000):
    d = i
    random.seed(d)
    flag = xor(ch,d)
    if "CTF" in flag:
        print(flag)
        break    


